let roomnum = 0;

io.on('connection', socket => {
    analyticsdata["visitationcount"]++;
    socket.on("createroom", (roomname, roompassword, maxplayers, roommap, name) => {
        if(roomname.replace(/\s/g, '') == ""){
            roomname = "Unnamed Room";
        }
        if(socket.game == null){
            if(maxplayers < 9 && maxplayers > 1 && Math.round(maxplayers) == maxplayers && mapData.hasOwnProperty(roommap)){
                socket.game = new Game(roomname, roompassword, maxplayers, roommap, roomnum);
                roomnum++;
                socket.myname = name;
                socket.mycolor = 0;
                socket.myideology = Math.floor(Math.random()*5)
                socket.game.players.push([socket, 0, 1, 0, [], socket.myideology, name]);
                gamelist.push(socket.game);
                socket.game.BroadcastPlayers();
                socket.playernum = 0;
            }
        }
    })

    socket.passwordattempt = false;
    socket.on("joinroom", (id, name, password, vialink) =>{
        if(socket.game == null){
            for(let i = 0; i < gamelist.length; i++){
                if(vialink && id == "#" + gamelist[i].randomval && gamelist[i].players.length < gamelist[i].maxplayers && gamelist[i].gamestate == "roomlobby"){
                    if(!socket.passwordattempt){
                        socket.passwordattempt = true;
                        socket.emit("passwordsuccess", true);
                        socket.game = gamelist[i];
                        socket.playernum = socket.game.players.length;
                        name = name.replace(/\W/g, '')
                        if(name.length > 12){
                            name = name.substring(0, 12);
                        }
                        socket.myname = name;
                        socket.mycolor = socket.game.unclaimedcolors.shift()
                        socket.myideology = Math.floor(Math.random()*5)
                        socket.game.players.push([socket, socket.game.players.length, 1, socket.mycolor, [], socket.myideology, name]);
                        socket.game.BroadcastPlayers();
                        socket.passwordattempt = false;
                        socket.emit("map", socket.game.map);
                    }
                }
                else if(id==gamelist[i].roomnum && gamelist[i].players.length < gamelist[i].maxplayers && gamelist[i].gamestate == "roomlobby"){
                    if(!socket.passwordattempt){
                        socket.passwordattempt = true;
                        setTimeout(()=>{
                            if(gamelist[i].password == password){
                                socket.emit("passwordsuccess", true);
                                socket.game = gamelist[i];
                                socket.playernum = socket.game.players.length;
                                name = name.replace(/\W/g, '')
                                if(name.length > 12){
                                    name = name.substring(0, 12);
                                }
                                socket.myname = name;
                                socket.mycolor = socket.game.unclaimedcolors.shift()
                                socket.myideology = Math.floor(Math.random()*5)
                                socket.game.players.push([socket, socket.game.players.length, 1, socket.mycolor, [], socket.myideology, socket.myname]);
                                socket.game.BroadcastPlayers();
                                socket.passwordattempt = false;
                                socket.emit("map", socket.game.map);
                            }
                            else {
                                socket.emit("passwordsuccess", false);
                                socket.passwordattempt = false;
                            }
                        }, 100)
                    }
                }
            }
        }
    })

    socket.on("changecolor", (val) =>{
        if(socket.game != null){
            if(socket.game.gamestate == "roomlobby"){
                if(socket.game.unclaimedcolors.includes(val)){
                    socket.mycolor = val;
                    socket.game.unclaimedcolors.splice(socket.game.unclaimedcolors.indexOf(val), 1);
                    socket.game.unclaimedcolors.push(socket.game.players[socket.playernum][3])
                    socket.game.players[socket.playernum][3] = val;
                    socket.game.unclaimedcolors.sort();
                    socket.game.BroadcastPlayers();
                }
            }
        }
    })

    socket.on("refreshrooms", ()=>{
        let roomemitdata = [];
        for(let i = 0; i < gamelist.length; i++){
            if(gamelist[i].gamestate == "roomlobby"){
                roomemitdata.push([gamelist[i].name, gamelist[i].players.length, gamelist[i].maxplayers, gamelist[i].map, gamelist[i].roomnum, gamelist[i].password == "" ? false : true]);
            }
        }
        socket.emit("roomlist", roomemitdata);
    })

    socket.on("leave", ()=>{
        if(socket.game != null){
            socket.game.RemovePlayer(socket.playernum);
            if(socket.game.players.length == 0){
                for(let i = 0; i < gamelist.length; i++){
                    if(socket.game == gamelist[i]){
                        gamelist.splice(i, 1);
                        break;
                    }
                }
            }
            socket.game = null;
        }
    })

    socket.on("disconnect", ()=>{
        if(socket.game != null){
            socket.game.RemovePlayer(socket.playernum);
            if(socket.game.players.length == 0){
                for(let i = 0; i < gamelist.length; i++){
                    if(socket.game == gamelist[i]){
                        gamelist.splice(i, 1);
                        break;
                    }
                }
            }
            socket.game = null;
        }
    })

    socket.on("start", ()=>{
        if(socket.game != null && socket.game.gamestate == "roomlobby"){
            if(socket.playernum == 0){
                socket.game.Start();
            }
        }
    })

    socket.on("attack", (index) => {
        if(socket.game != null){
            socket.game.Attack(index, socket.playernum)
        }
    })

    socket.on("build", (index, type) =>{
        if(socket.game != null && socket.game.turn == socket.playernum){
            socket.game.BuildImprovement(index, type);
        }
    })

    socket.on("changeideology", (type) =>{
        if(socket.game != null && Number.isInteger(type) && type >= 0 && type < 5){
            socket.game.ChangeIdeology(type, socket.playernum);
            socket.myideology = type;
        }
    })

    socket.on("kick", (num)=> {
        if(socket.game != null && socket.playernum == 0 && socket.game.gamestate == "roomlobby" && Number.isInteger(num) && socket.game.players.length > num && num > 0){
            socket.game.players[num][0].emit("kicked", true);
            socket.game.players[num][0].game = null;
            socket.game.RemovePlayer(num);
        }
    })

    socket.on("playagain", ()=>{
        if(socket.game != null && (socket.game.gamestate == "roomlobby" || socket.game.gamestate == "endscreen")){
            socket.game.PlayAgain(socket, socket.myname, socket.mycolor, socket.myideology);
        }
    })

})

io.listen(server);


function Count(array, searchval){
    let count = 0;
    array.forEach((el) =>{
        if(el == searchval){
            count++;
        }
    });
    return count;
}